import React, { useState } from "react";
import "../App.css";

function ProjectsDisplay() {
    const [activeProject, setActiveProject] = useState("project1");

    const projects = {
        project1: {
            name: "E-commerce System",
            content: "https://via.placeholder.com/600x400.png?text=E-commerce+System"
        },
        project2: {
            name: "Mobile App",
            content: "https://via.placeholder.com/600x400.png?text=Mobile+App"
        },
        project3: {
            name: "Machine Learning Model",
            content: "https://via.placeholder.com/600x400.png?text=Machine+Learning+Model"
        },
        project4: {
            name: "Data Visualization Project",
            content: "https://via.placeholder.com/600x400.png?text=Data+Visualization+Project"
        }
    };

    return (
        <div id="projects" className="PROJ">
            <h1 className="PROJH">Projects</h1>
            <div className="flex-containerp">
                <div className="proj-list-container">
                    <ul>
                        <li onClick={() => setActiveProject("project1")}>E-commerce System</li>
                        <hr></hr>
                        <li onClick={() => setActiveProject("project2")}>Mobile App</li>
                        <hr></hr>
                        <li onClick={() => setActiveProject("project3")}>Machine Learning Model</li>
                        <li onClick={() => setActiveProject("project4")}>Data Visualization Project</li>
                    </ul>
                </div>
                <div>
                    <h2>{projects[activeProject].name}</h2>
                    <img src={projects[activeProject].content} alt={projects[activeProject].name} />
                </div>
            </div>
        </div>
    );
}

export default ProjectsDisplay;
